import React from "react";
import { Image } from "./Image";

import tobogan from "../assets/images/tobogan.jpg";


export const Producto = ({ titulo }, {src}) => {

    return(
        <div class="catalog">
            <div class="product-card">
                <div class="product-title">
                    <h1>{titulo}</h1>
                </div>
                <div class="product-image">
                    <Image src={src}/>
                </div>
            </div>
        </div>
    );
};
